  'faq.notSatisfiedAnswer': 'Ми хочемо, щоб ви були повністю задоволені. Якщо ви не задоволені своєю послугою, зв\'яжіться з нами протягом 48 годин. Ми працюватимемо з вами та спеціалістом, щоб вирішити будь-які проблеми.',
  'faq.specialistsVerified': 'Як перевіряються спеціалісти?',
  'faq.specialistsVerifiedAnswer': 'Усі наші спеціалісти проходять ретельний процес перевірки, включаючи перевірку біографії, верифікацію кваліфікації та оцінку навичок. Ми також постійно відстежуємо відгуки та рейтинги.',
  'faq.leaveReview': 'Чи можу я залишити відгук?',
  'faq.leaveReviewAnswer': 'Так! Ми заохочуємо вас залишати відгуки після завершення послуги. Це допомагає іншим клієнтам приймати обґрунтовані рішення та допомагає спеціалістам покращувати свої послуги.',
  'faq.personalInfoSecure': 'Чи захищена моя особиста інформація?',
  'faq.personalInfoSecureAnswer': 'Абсолютно. Ми використовуємо стандартне для індустрії шифрування та заходи безпеки для захисту вашої особистої інформації. Ми ніколи не передаємо ваші дані третім сторонам без вашої згоди.',
  'faq.updateProfile': 'Як оновити свій профіль?',
  'faq.updateProfileAnswer': 'Перейдіть до налаштувань свого акаунта, щоб оновити інформацію профілю, способи оплати, адреси та налаштування. Зміни зберігаються автоматично.',
